import React from 'react';
import { useGoogleAuth } from './GoogleAuthProvider';

const SignoutButton = () => {
    const { signOut } = useGoogleAuth();

    return (
        <p onClick={signOut} id="signoutbtn">Logout</p>
      );
};

export default SignoutButton;
